function AssessmentWizard(e){this.props=e,this.isUpScrollerShowed=!1}AssessmentWizard.prototype.init=function(){this.$element=$(this.props.dom);var e=this,o=this.$element.find(".wizard-content");o.on("scroll",function(o){o.target.scrollTop>o.target.clientHeight/2?!e.isUpScrollerShowed&&e.showUpScroller():e.isUpScrollerShowed&&e.hideUpScroller()}),this.$element.find(".up-scroller").on("click",function(){o.scrollTo(0,500)})},AssessmentWizard.prototype.showUpScroller=function(){this.isUpScrollerShowed=!0,this.$element.find(".up-scroller").show()},AssessmentWizard.prototype.hideUpScroller=function(){this.isUpScrollerShowed=!1,this.$element.find(".up-scroller").hide()};